import logo from './logo.svg';
import './App.css';
import Splash from './SplashScreen';
import React from 'react';
import {Router, Route, Routes} from 'react-router-dom';

function App() {
  return (
    <Router>
      <Routes>
        <Route path = "/" element={<Splash />}/>
      </Routes>
    </Router>
  );
}

export default App;
